import React from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonLabel, IonItem } from '@ionic/react';
import './Tab1.css';

const Tab1: React.FC = () => {
  return (
    <IonPage>
      <IonContent>
        <IonHeader collapse="condense">
          <IonToolbar>
            <IonTitle class="tab-title" size="large">Track your daily chores here!</IonTitle>
          </IonToolbar>
        </IonHeader>
        <IonItem>
          <IonLabel>
            Daily chore 1
        </IonLabel>
          </IonItem>
      </IonContent>
    </IonPage>
  );
};

export default Tab1;
